import React from 'react';

const Menu = () => {
  return (
    <div className="ui secondary vertical pointing menu">
      <a class="active item">Home</a>
      <a class="item">Movies</a>
      <a class="item">TV Shows</a>
    </div>
  );
};

export default Menu;
